{"query":"{
				actor {

				MXxFWFR8U0VSVklDRV9MRVZFTHwzMTU3Mzg: entity(guid: "MXxFWFR8U0VSVklDRV9MRVZFTHwzMTU3Mzg") {
					nrdbQuery(nrql: "SELECT clamp_max(sum(newrelic.sli.good) / sum(newrelic.sli.valid) * 100, 100) AS 'SLI' FROM Metric WHERE sli.guid = 'MXxFWFR8U0VSVklDRV9MRVZFTHwzMTU3Mzg' UNTIL 2 minutes AGO SINCE 7 DAY AGO", timeout: 60, async: true) {
						results
					}
				}
				MXxFWFR8U0VSVklDRV9MRVZFTHwzMTU3Mzc: entity(guid: "MXxFWFR8U0VSVklDRV9MRVZFTHwzMTU3Mzc") {
					nrdbQuery(nrql: "SELECT clamp_max((sum(newrelic.sli.valid) - sum(newrelic.sli.bad)) / sum(newrelic.sli.valid) * 100, 100) AS 'SLI' FROM Metric WHERE sli.guid = 'MXxFWFR8U0VSVklDRV9MRVZFTHwzMTU3Mzc' UNTIL 2 minutes AGO SINCE 7 DAY AGO", timeout: 60, async: true) {
						results
					}
				}}
			}"}

