{"query":"query getErrorGroup($accountId: Int!, $errorGroupGuids: [ID!], $entityGuid: EntityGuid!) {
			actor {
			  account(id: $accountId) {
			    name
			  }
			  entity(guid: $entityGuid) {
				alertSeverity
				name
				relatedEntities(filter: {direction: BOTH, relationshipTypes: {include: BUILT_FROM}}) {
				  results {
					source {
					  entity {
						name
						guid
						type
						entityType
					  }
					}
					target {
					  entity {
						name
						guid
						type
						entityType
						tags {
						  key
						  values
						}
					  }
					}
					type
				  }
				}
			  }
			  errorsInbox {
				errorGroupStateTypes {
				  type
				}
				errorGroups(filter: {ids: $errorGroupGuids} ) {
				  results {
					url
					id
					message
					name
					state
					entityGuid
					assignment {
					  email
					  userInfo {
						gravatar
						id
						name
					  }
					}
					state
					eventsQuery
				  }
				}
			  }
			}
		  }","variables":{"accountId":1,"errorGroupGuids":["MXxFUlR8RVJSX0dST1VQfDVkOTBlNzQ2LWU2NWUtMzYxOS1iMmIyLTEyNDEwNTliYmIyMg"],"entityGuid":"MXxBUE18QVBQTElDQVRJT058MTg4ODMyODI"}}

